//import logo from './logo.svg';
import './App.css';
import React from 'react';
import { PageNotFound } from './components/PageNotFound';
import { Tasks } from './components/Tasks';

function App() {

  return (
    <div className="App">
      <div>
        <Routes>
          <Route path="" element={<Tasks/> } />      
          <Route path="*" element={ <PageNotFound/>} />
        </Routes>
      </div>
    </div>
  );
}

export default App;
